import React from "react";
import { NextPage } from "next";
import { NextSeo } from "next-seo";

import { STop } from "./style"

type Props = {};

const ApplePodcast: NextPage<Props, any> = ({ }) => {
  return (
    <div>
      <NextSeo title="苹果播客" />
      <div style={{width: '414px', height: '841px', backgroundColor: 'green', margin: '0 auto'}}>
        <STop>
          <p>00:00</p>
          <img src="/library/content/dam/edam/applecare/images/en_US/iOS/ios10-location-status-icon.png" alt=""/>
        </STop>
      </div>
    </div>
  );
};

ApplePodcast.getInitialProps = async () => {
  return {
    namespacesRequired: ["common"],
  };
};

export default ApplePodcast;
